import Card from '../components/card'
import Notif from '../components/notif'

const Container = () => {
    const isLogin = !!localStorage.getItem('user')
    return (
        <div fluid className="mt-md-3 flu ">
            <div className="CardGroup d-flex flex-row gap-2 justify-content-center flex-wrap">
                <Card />
                {
                            isLogin ? (
                                <></>
                                ) : (
                                <Notif />
                            )
                        }
            </div>
        </div>
    )
}

export default Container
